import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

export function templateAnime({LinkComics, tituloComic}){
    return(
        <div>
            <iframe width="1268" height="713" src="https://www.youtube.com/embed/mOmczexloR8" title="HxH1" frameborder="0"  allowfullscreen></iframe>
